import React from 'react';

function ResultView({ metadata }) {
  return (
    <section>
      <h2>Shard Details</h2>
      {metadata.map((shard, index) => (
        <div key={index}>
          <p>File: {shard.shard_file}</p>
          <p>Rows: {shard.rows}</p>
          <p>Columns: {shard.columns.join(', ')}</p>
        </div>
      ))}
    </section>
  );
}

export default ResultView;
